DROP TABLE IF EXISTS `orderdetails`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!40101 SET character_set_client = utf8 */;
CREATE TABLE `orderdetails` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `trans_no` bigint(20) NOT NULL,
  `item_id` int(11) NOT NULL,
  `cashier_id` int(11) DEFAULT NULL,
  `quantity` int(11) NOT NULL CHECK (`quantity` > 0),
  `discount` decimal(10,0) NOT NULL,
  `price` decimal(10,2) NOT NULL CHECK (`price` >= 0),
  `total_price` decimal(10,2) NOT NULL,
  `notes` text DEFAULT NULL,
  `order_type` varchar(10) NOT NULL DEFAULT 'Dine-In',
  `order_time` time NOT NULL DEFAULT current_timestamp(),
  `order_date` date NOT NULL DEFAULT current_timestamp(),
  `created_at` timestamp NOT NULL DEFAULT current_timestamp(),
  PRIMARY KEY (`id`),
  KEY `idx_item_id` (`item_id`),
  KEY `fk_orderdetails_cashier` (`cashier_id`),
  KEY `fk_trans_no` (`trans_no`),
  CONSTRAINT `fk_orderdetails_cashier` FOREIGN KEY (`cashier_id`) REFERENCES `users` (`id`),
  CONSTRAINT `fk_trans_no` FOREIGN KEY (`trans_no`) REFERENCES `transactions` (`transNumber`),
  CONSTRAINT `orderdetails_ibfk_2` FOREIGN KEY (`item_id`) REFERENCES `product` (`pId`) ON DELETE CASCADE
) ENGINE=InnoDB AUTO_INCREMENT=242 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_general_ci;
